import React from "react";

import classes from "./Home.module.css";

const Home = (props) => {
  return (
    <div className={classes.home} id={props.id}>
      <div className={classes.content}>
        <div className={classes.details}></div>
      </div>
    </div>
  );
};

export default Home;
